import { BlogAuthor } from './blog-author.model';
import { BlogPostStatus } from './blog-post-status.model';
import { BlogTopic } from './blog-topic.model';
export class BlogPost {
  constructor(partial) {
    Object.assign(this, partial);
  }
  deserialize(input) {
    Object.assign(this, input);
    this.author = input.author.map(ba => new BlogAuthor({
      ...ba
    }).deserialize(ba));
    this.status = input.status.map(bps => new BlogPostStatus({
      ...bps
    }).deserialize(bps));
    this.topics = input.topics.map(bt => new BlogTopic({
      ...bt
    }).deserialize(bt));
    return this;
  }
}
